INSERT INTO `place` VALUES ('402881888172c6d6018172c74fb70004',1,NULL,'Buenos Aires, Argentina','Buenos_Aires',NULL,'The city of tango and most cosmopolitan in Argentina.',NULL,NULL,'Buenos Aires','city',1,'Buenos Aires is a city and capital of Argentina recommended for its Empanada, museums and the Casa Rosada. Admire creations by the famous architect, Jules Dormal, for instance Palace of the Argentine National Congress. Come here for your gourmet pleasures and the party scene.'),('402881888172c6d6018172c74fbd0007',1,'Barcelona','Barcelona, Barcelona, Spain','Barcelona',NULL,'Capital of Catalonia and home to Gaud\'s famous Sagrada Famlia this place is much more than \"Spain\'s second city\".',2.177432,41.382894,'Barcelona','city',2,'Barcelona is a city recommended for its Tapas, museums and the Sagrada Famlia. It has 9 World Heritage sites, for example the Park Gell. Admire creations by the famous architect, Antoni Gaud, for example Casa Vicens. Go and see \"Naked Woman Climbing a Staircase\" of Joan Mir. Come here for your gourmet pleasures and the vibrant scene.'),('402881888172c6d6018172c74fc0000a',1,'Rome','Rome, Rome, Italy','Rome',NULL,'An empire was named after this eternal city of seven hills and today it is chock full of old and new, and even contains its own state, the Vatican.',12.482932,41.89332,'Rome','city',3,'Rome is a city and capital of Italy recommended for its Saltimbocca, palaces and the Roman Forum. It has 5 World Heritage sites, for instance the Colosseum. See creations by the famous architect, Bernini, for example St. Peter\'s Square. Go and admire \"The Entombment of Christ\" of Caravaggio. Well known for its party scene.'),('402881888173c235018173c37cfd0004',1,'Venice','Venice, Venice, Italy','Venice',NULL,'Venice is known for several important artistic movementsespecially during the Renaissance periodand has played an important role in the history of instrumental and operatic music, and is the birthplace of Baroque composers Tomaso Albinoni and Antonio Vivaldi.',12.268821,45.477166,'Venice','city',3,'Venice is a city recommended for its Tiramisu, churches and the Piazza San Marco. It has 2 World Heritage sites, for instance the Palazzo Molina. Admire creations by the famous architect, Palladio, for instance Church of San Giorgio Maggiore. Go and admire \"Piet\" of Titian. Come here also for your gourmet pleasures.'),('402881888173c235018173c37d100007',0,NULL,'Paris, France',NULL,NULL,NULL,2.35183,48.85658,'Paris',NULL,6,NULL),('402881888173c235018173c37d13000a',1,'England','London, Greater London, England, United Kingdom','London',NULL,'Europe\'s financial metropolis and the former heart of the British Empire, packed with all sorts of attractions from sports to museums and two millennia of history.',-0.091998,51.515618,'London','city',7,'London is a city and capital of United Kingdom recommended for its Wine, museums and the Buckingham Palace. It has 6 World Heritage sites, for instance the Tower of London. See creations by the famous architect, Waterhouse, for example Natural History Museum. Go and see \"The Graham Children\" of William Hogarth. Come here for your gourmet pleasures and the vibrant scene.'),('402881888173c235018173c37d14000d',0,'Madrid','Madrid, Madrid, Spain',NULL,NULL,NULL,-3.703583,40.416705,'Madrid',NULL,2,NULL),('402881888173c235018173c37d150010',0,'North Holland','Amsterdam, North Holland, Netherlands',NULL,NULL,NULL,4.893604,52.37276,'Amsterdam',NULL,9,NULL),('402881888173c235018173c5b50c00d0',1,'New York','New York City, New York, United States','New_York_City',NULL,'Possibly the most well known and celebrated city in the world, New York is a city of towering skyscrapers, ethnic diversity, international corporations, and incomparable culture.',-73.9866,40.7306,'New York City','city',10,'New York City is a city recommended for its Hot dog and museums like the Metropolitan Museum of Art. Admire creations by the famous architect, Stone, for example Museum of Modern Art. Go and admire \"The Allegory of Faith\" of Johannes Vermeer. Come here for your gourmet pleasures and the vibrant scene.'),('402881888173c235018173c5b51900d3',1,'Florida','Miami, Florida, United States','Miami',NULL,'Greater Downtown Miami has one of the largest concentrations of international banks in the United States, and is home to many large national and international companies.',-80.19362,25.774173,'Miami','city',10,'Miami is a city recommended for its Cuban sandwich and museums like the Vizcaya Museum and Gardens.'),('402881888173c235018173c5b51d00d6',1,'Nevada','Las Vegas, Nevada, United States','Las_Vegas',NULL,'Many of Las Vegas\' largest casinos have branches there.',-115.148516,36.167256,'Las Vegas','city',10,'Las Vegas is a city known for its Mush, casinos and the Neon Museum. Well known for your gourmet pleasures and the vibrant scene.'),('402881888173c235018173c5b52100d9',1,'Florida','Orlando, Florida, United States','Orlando2C_Florida',NULL,'Census Bureau figures released in July 2017, making it the 23rd-largest metropolitan area in the United States, the sixth-largest metropolitan area in the Southern United States, and the third-largest metropolitan area in Florida behind Miami and Tampa.',-81.37903,28.542111,'Orlando','city',10,'Orlando is a city recommended for its Cuban sandwich and amusement parks like the Universal Orlando Resort. Admire creations by the famous architect, Stern, for example Disney\'s Beach Club Resort. Come here also for your gourmet pleasures.'),('402881888173c235018173c5b52400dc',1,'California','San Francisco, California, United States','San_Francisco',NULL,'The de facto center and the iconic city of the region, home to such landmarks as the Golden Gate Bridge, the hilly streets with their famous cable cars and Victorian houses, the infamous island prison of Alcatraz, and enough museums and intriguing neighborhoods to keep a traveler exploring for days.',-122.419906,37.779026,'San Francisco','city',10,'San Francisco is a city recommended for its Cioppino, parks and the Golden Gate Bridge. Admire creations by the famous architect, Arthur Brown, for example Coit Tower. Come here for your gourmet pleasures and the vibrant scene.'),('402881888173c235018173c5b52500df',1,'California','Los Angeles, California, United States','Los_Angeles',NULL,'While many places claim to have \"something for everyone\", Los Angeles County actually does.',-118.242766,34.053691,'Los Angeles','city',10,'Los Angeles is a city recommended for its French dip and museums like the Natural History Museum of Los Angeles County. Admire creations by the famous architect, Pereira, such as Los Angeles County Museum of Art. Come here for your gourmet pleasures and the vibrant scene.'),('402881888173c235018173c6be2b024d',1,'Quintana Roo','Cancn, Quintana Roo, Mexico','CancC3BAn',NULL,'Do not expect to see Mexican historical culture here; instead, it\'s modern Mexico with many restaurants, North American fast food chains, shopping centers, markets and clubs.',-86.8475,21.16056,'Cancn','city',16,'Cancn is a city recommended for its Guacamole, beaches and the Cancn Underwater Museum.'),('402881888173c235018173c6be2f0250',1,NULL,'Mexico City, Mexico','Mexico_City',NULL,'The capital city of Mexico, the third-largest city in the world is chock-full of museums, centuries-old architecture, modern amenities... and people.',-99.14556,19.41944,'Mexico City','city',16,'Mexico City is a city and capital of Mexico recommended for its Pozole, churches and the Museo Nacional de Antropologa. It has 5 World Heritage sites, for example the Luis Barragn House and Studio. Admire creations by the famous architect, Manuel Tols, for example Mexico City Metropolitan Cathedral. Well known for your gourmet pleasures and the vibrant scene.'),('402881888173c235018173c6be300253',1,'Guerrero','Acapulco, Guerrero, Mexico','Acapulco',NULL,'The resort area is divided into three parts.',-99.88701,16.86287,'Acapulco','city',16,'Acapulco is a city known for its beaches and the Fuerte de San Diego.'),('402881888173c235018173c7e0a60324',1,'Mendoza','Mendoza, Mendoza, Argentina','Mendoza2C_Argentina',NULL,'Although it is in an extremely dry desert region, Mendoza has an extensive artificial irrigation system, which allows for greenery throughout the city as well as the growth of grapes used to make its wines.',-68.83333,-32.88333,'Mendoza','city',1,'Mendoza is a city recommended for its Empanada, sport venues and the Zoolgico de Mendoza.'),('402881888173c235018173c7e0a90327',1,'Crdoba','Crdoba, Crdoba, Argentina','CC3B3rdoba2C_Argentina',NULL,'Although the oldest buildings are found in the surroundings of the Plaza San Martn (microcentro), the most pleasant areas are now the Nueva Crdoba district south of the center and the area around the Caada, a small colonial canal that crosses the city.',-64.18333,-31.41667,'Crdoba','city',1,'Crdoba is a city recommended for its museums and the Cathedral of Crdoba. It has one World Heritage site, namely Jesuit Block and Estancias of Crdoba.'),('402881888173c235018173c7e0aa032a',1,'Ro Negro','San Carlos de Bariloche, Ro Negro, Argentina','Bariloche',NULL,'Arguably the most visited city in Argentinian Patagonia, it is famous for skiing and is great for sightseeing, water sports, trekking and climbing.',-71.3,-41.15,'San Carlos de Bariloche','city',1,'San Carlos de Bariloche is a city recommended for its Empanada and the Cathedral of Our Lady of Nahuel Huapi.'),('402881888173c235018173c7e0ab032d',1,'San Juan','San Juan, San Juan, Argentina','San_Juan2C_Argentina',NULL,'San Juan is the capital and largest city of the Argentine province of San Juan in the Cuyo region, located in the Tulm Valley, west of the San Juan River, at 650m above mean sea level, with a population of around 112,000 as per the (over 500,000 in the metropolitan area).',-68.53639,-31.5375,'San Juan','city',1,'San Juan is a city recommended for the San Juan de Cuyo Cathedral.'),('402881888173c235018173c7e0ad0330',1,'Salta','Salta, Salta, Argentina','Salta',NULL,'The city serves as the cultural and economic center of the Valle de Lerma Metropolitan Area (Spanish. rea Metropolitana del Valle de Lerma, AMVL), which is home to over 50.9% of the population of Salta Province and also includes the municipalities of La Caldera, Vaqueros, Campo Quijano, Rosario de Lerma, Cerrillos, La Merced and San Lorenzo.',-65.41056,-24.78833,'Salta','city',1,'Salta is a city recommended for its Empanada, museums and the Cathedral of Salta.'),('402881888173c235018173c85e8d045e',0,'Rio de Janeiro','Rio de Janeiro, Rio de Janeiro, Brazil',NULL,NULL,NULL,-43.2094,-22.911,'Rio de Janeiro',NULL,24,NULL),('402881888173c235018173c85e940461',1,'Guayas','Guayaquil, Guayas, Ecuador','Guayaquil',NULL,'Now you can find great parks and green areas all over the city (for example Peas and the Malecon), and the city has a new look which attracts tourism from inside and outside the country.',-79.88333,-2.18333,'Guayaquil','city',25,'Guayaquil is a city recommended for its Ceviche, sport venues and the Guayaquil Metropolitan Cathedral.'),('402881888173c235018173c85e960464',1,'Lima Province','Lima, Lima Province, Peru','Lima',NULL,'The sprawling, Pacific coast capital of Peru is a center of cuisine.',-76.8333,-12,'Lima','city',26,'Lima is a city and capital of Peru recommended for its Ceviche, shopping centres and the Archbishop\'s Palace of Lima. It has one World Heritage site, namely Historic Centre of Lima. Admire creations by the famous architect, de Jaxa Malachowski, such as Government Palace.'),('402881888173c235018173c85e960467',1,'Cusco','Cusco, Cusco, Peru','Cusco',NULL,'Cuzco is a beautiful city with well-preserved colonial architecture, evidence of a rich and complex history.',-72,-13.5,'Cusco','city',26,'Cuzco is a city recommended for its Pisco sour, churches and the Sacsayhuamn.'),('402881888173c235018173c85e98046a',1,NULL,'Bogot, Colombia','BogotC3A1',NULL,'A city of contrasts with a hectic balance between the new and the old; the most cultural-minded of South American capitals.',-74.08083,4.59889,'Bogot','city',28,'Bogot is a city and capital of Colombia recommended for its Ajiaco and museums like the Gold Museum. Admire creations by the famous architect, Lelarge, for instance Capitolio Nacional.'),('402881888173c235018173c909650591',0,'Bolvar','Cartagena of Indias, Bolvar, Colombia',NULL,NULL,NULL,-75.52528,10.42361,'Cartagena of Indias',NULL,28,NULL),('402881888173c235018173c9096e0594',1,'Magdalena','Santa Marta, Magdalena, Colombia','Santa_Marta',NULL,'Founded on July 29, 1525, by the Spanish conqueror Rodrigo de Bastidas, it was the first Spanish settlement in Colombia, its oldest surviving city, and second oldest in South America.',-74.20167,11.23611,'Santa Marta','city',28,'Santa Marta is a city recommended for its Ceviche, museums and the Rodadero Sea Aquarium and Museum.'),('402881888173c235018173c909720597',1,'Pernambuco','Recife, Pernambuco, Brazil','Recife',NULL,'Recife is the fourth-largest urban area in Brazil with 4,054,866 inhabitants, the largest urban area of the North/Northeast Regions, and the capital and largest city of the state of Pernambuco in the northeast corner of South America.',-34.8782,-8.0642,'Recife','city',24,'Recife is a city known for its museums and the Metrpole. Well known for its party scene.'),('402881888173c235018173c90973059a',1,'Santa Catarina','Florianpolis, Santa Catarina, Brazil','FlorianC3B3polis',NULL,'It is possible it will open for pedestrians and cyclists.',-48.5496,-27.5973,'Florianpolis','city',24,'Florianopolis is a city known for its beaches like the Jurer.'),('402881888173c235018173c9843f064c',0,'Pernambuco','Fernando de Noronha, Pernambuco, Brazil',NULL,NULL,NULL,-32.4248,-3.8561,'Fernando de Noronha',NULL,24,NULL),('402881888173c235018173c9844b064f',1,'Rio Grande do Norte','Natal, Rio Grande do Norte, Brazil','Natal2C_Rio_Grande_do_Norte',NULL,'Nowadays Natal is one of the 8 most visited cities of Brazil.',-35.2081,-5.8054